SET client_encoding = 'UTF-8';

CREATE TABLE "strutture"
 (
	"cod_az"			VARCHAR (6), 
	"codice2005"			VARCHAR (12), 
	"cod_strut"			VARCHAR (510), 
	"den"			VARCHAR (510), 
	"cod_comune"			VARCHAR (12), 
	"comune"			VARCHAR (510), 
	"indirizzo"			VARCHAR (510), 
	"private"			BOOL NOT NULL, 
	"ospedale"			BOOL NOT NULL, 
	"attiva"			BOOL NOT NULL, 
	"casa_cura"			BOOL NOT NULL, 
	"ria"			BOOL NOT NULL, 
	"tariffa"			BOOL NOT NULL
);

-- CREATE INDEXES ...
CREATE INDEX "strutture_codice2005_idx" ON "strutture" ("codice2005");
CREATE INDEX "strutture_Codice2006_idx" ON "strutture" ("cod_strut");


